// App.js

import React, { useState } from 'react';
import GenderDropdown from './dropdowns/Gender';
import LetterDropdown from './dropdowns/Letter';
import OriginDropdown from './dropdowns/Country';
import { Genders } from './dropdowns/menus/options.ts';
import { letters } from './dropdowns/menus/options.ts';
import { country } from './dropdowns/menus/options.ts';
import './App.css'



function App() {
    const [selectedGender, setSelectedGender] = useState('');
    const [selectedLetter, setSelectedLetter] = useState('');
    const [selectedOrigin, setSelectedOrigin] = useState('');

    const handleSelectGender = (selectedOption) => {
        setSelectedGender(selectedOption);
    };

    const handleSelectLetter = (selectedOption) => {
        setSelectedLetter(selectedOption);
    };

    const handleSelectOrigin = (selectedOption) => {
        setSelectedOrigin(selectedOption);
    };

    const handleSubmit = () => {
        if (!selectedGender || !selectedLetter || !selectedOrigin) {
            alert('Please select gender, letter, and origin.');
            return;
        }
        console.log('Selected gender:', selectedGender);
        console.log('Selected letter:', selectedLetter);
        console.log('Selected origin:', selectedOrigin);
    };

    return (
        <div className="App">
            <h1>Baby Name Generator</h1>
            <GenderDropdown options={Genders} onSelectGender={handleSelectGender} />
            <LetterDropdown options={letters} onSelectLetter={handleSelectLetter} />
            <OriginDropdown options={country} onSelectOrigin={handleSelectOrigin} />
            <button onClick={handleSubmit}>Submit</button>
        </div>
    );
}

export default App;
